import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const IconContainer = styled.span`
  display: inline-flex;
  align-items: center;
  justify-content: center;
  font-size: 1.2rem;
`;

const Icon = ({ component: IconComponent }) => (
  <IconContainer>
    <IconComponent />
  </IconContainer>
);

export const SearchIcon = () => <Icon component={BsSearch} />;
export const ChartIcon = () => <Icon component={BsBarChart} />;
export const GearIcon = () => <Icon component={BsGear} />;
export const FileIcon = () => <Icon component={BsFileText} />;
export const FilterIcon = () => <Icon component={BsFilter} />;
export const SaveIcon = () => <Icon component={BsSave} />;
export const TrashIcon = () => <Icon component={BsTrash} />;
